import React from "react";

function TaskItem({ task }) {
  return (
    <li className={`list-group-item d-flex justify-content-between align-items-center ${task.done ? 'list-group-item-success' : ''}`}>
      {task.text}
    </li>
  );
}

export default TaskItem;
